/**
 * Get column headers for <EntryViewer>
 *
 * @return {({id: string, label: string}|{id: string, label: string})[]}
 */
export function getFormColumns(form, entryListOnly = true, includeEntryActions = true ) {
	const {entry_list,order} = form.field_details;
	let columns = Object.values(entry_list);
	if( ! entryListOnly ){
		Object.values(order).forEach(orderedField => {
			columns.push(orderedField);
		});
	}

	if (includeEntryActions) {
		columns.push({
			name: "Actions",
			id: 'entryActions',
			key: 'entryActions',
		});
	}

	return columns;

}

import React from 'react';
import {EntryRowActions} from "./EntryRowActions";

/**
 * Get the form entry rows for <EntryViewer>
 * @return {*}
 */
export default function getFormRows(
	entries,
	onEntryAction,
	entryListOnly = true,
	includeEntryActions = true,
) {

	let rows = [];
	Object.keys(entries).forEach(id => {
		const entry = entries[id];
		let thisRow = {
			id: entry.id,
			datestamp: entry.datestamp,
			user: 'object' === typeof entry.user ? entry.user : {},
		};



		if (!entryListOnly) {
			Object.values(entry.fields).forEach(entryField => {
				thisRow[entryField.field_id] = entryField.value;
			});
		}

		if (includeEntryActions) {
			thisRow.entryActions = (
				<EntryRowActions
					onView={() => {
						onEntryAction('viewForm', id);
					}}
				/>
			);
		}


		rows.push(thisRow);

	});
	return rows;


}

