import deepmerge from 'deepmerge';

/**
 * Provides CF Pro Local settings, with defaults merged to stored values.
 *
 * @param {Object} stored Stored values
 */
export const proLocalSettingsFactory = (stored = {} ) => {
	const defaults = {
		connected: false,
		generalSettings : {
			enhancedDelivery: false,
			generatePDFs: false,
			logLevel: 200
		},
		apiKeys: {
			public: '',
			secret: '',
			token: ''
		}

	};
	return deepmerge(
		defaults,
		stored,
	);


};

/**
 * Creates option values for select fields
 * @param {String|number|Boolean} value Value of option
 * @param {String|number} label Optional. Label for option
 * @param {Object} other Optional. Additional data to add
 * @return {{value: *, label: *}}
 */
export const optionFactory = (value, label = null, other = {} ) => {
	return {
		...other,
		value,
		label: label ? label : value,
	}
};

export const pickArray = (array, key) => {
	return array.reduce(
		(accumualtor, item) =>
			accumualtor.concat([item[key]]), []
	);
}

